  [],\n\t\"revision_timestamp\": \"2015-05-06T22:31:56.207017\",\n\t\"name\": \"extravehicular-activity-suit-portable-life-support-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The objective of this project is
  to mature technologies and systems that will enable future Extravehicular Activity
  (EVA) systems. Advanced EVA systems have applicability to all future human spaceflight
  missions. Advanced EVA systems have applications to current operations on the International
  Space Station (ISS), to extended operations on ISS past 2020, future missions to
  Low Earth Orbit (LEO) such as satellite servicing, missions beyond LEO such as exploration
  of asteroids, and surface exploration missions to the Moon or Mars. An EVA system
  would be a significant element of any future human exploration mission and will
  enable suitport operations in a Deep Space Habitat or Multi-Mission Space Exploration
  Vehicle (MMSEV). The Human Exploration Framework Team (HEFT) ranked EVA systems
  as one of the top five needed areas of future development for human space flight.
  The goal is to produce real cost, performance, and reliability data through building
  and testing high fidelity systems, culminating in a flight demonstration on ISS
  of an exploration Extravehicular Mobility Unit (EMU). The current plan leading to
  this flight demonstration consists of subsystem demonstrations of increasing fidelity.
  These demonstrations would produce hardware and systems that could then be combined
  into a complete EVA system which would be used in human thermal-vacuum chamber tests
  and finally in a flight demonstration.&lt;/p&gt;\",\n\t\"license_title\": \"U.S.
